import React from 'react';

const Table1 = () => {
  const jsonData = [
    {
      sno: 2203,
      cname: 'MKRISHNAPPA',
      pname: 'BharatiyaJanataParty',
      evmvotes: 195564,
      postalvotes: 656,
      totvotes: 196220,
      percentofvotes: 51.35,
      constname: 'BangaloreSouth',
      constkey: 176,
    },
    {
      sno: 2173,
      cname: 'MANJULAS',
      pname: 'BharatiyaJanataParty',
      evmvotes: 181268,
      postalvotes: 463,
      totvotes: 181731,
      percentofvotes: 54.31,
      constname: 'Mahadevapura',
      constkey: 174,
    },
  ];

  const table1Style = {
    borderCollapse: 'collapse',
    width: '100%',
  };

  const table1HeaderStyle = {
    border: '1px solid black',
    padding: '8px',
    backgroundColor: '#f2f2f2',
    textAlign: 'center',
  };

  const table1CellStyle = {
    border: '1px solid black',
    padding: '8px',
    textAlign: 'center',
  };

  return (
    <table1 style={table1Style}>
      <thead>
        <tr>
          <th style={table1HeaderStyle}>Sno</th>
          <th style={table1HeaderStyle}>Candidate Name</th>
          <th style={table1HeaderStyle}>Party Name</th>
          <th style={table1HeaderStyle}>EVM Votes</th>
          <th style={table1HeaderStyle}>Postal Votes</th>
          <th style={table1HeaderStyle}>Total Votes</th>
          <th style={table1HeaderStyle}>Percentage of Votes</th>
          <th style={table1HeaderStyle}>Constituency Name</th>
          <th style={table1HeaderStyle}>Constituency Key</th>
        </tr>
      </thead>
      <tbody>
        {jsonData.map((data) => (
          <tr key={data.sno}>
            <td style={table1CellStyle}>{data.sno}</td>
            <td style={table1CellStyle}>{data.cname}</td>
            <td style={table1CellStyle}>{data.pname}</td>
            <td style={table1CellStyle}>{data.evmvotes}</td>
            <td style={table1CellStyle}>{data.postalvotes}</td>
            <td style={table1CellStyle}>{data.totvotes}</td>
            <td style={table1CellStyle}>{data.percentofvotes}</td>
            <td style={table1CellStyle}>{data.constname}</td>
            <td style={table1CellStyle}>{data.constkey}</td>
          </tr>
        ))}
      </tbody>
    </table1>
  );
};

export default Table1;
